import React from "react";
import PropTypes from "prop-types";
import Head from "next/head";

import Navigation from "../components/navigation";

const App = ({ Component }) => {
  return (
    <div>
      <Head>
        <meta name="viewport" />
        <title>MySNS</title>
      </Head>
      <Navigation />
      <Component />
    </div>
  );
};

App.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
